  name: HttpStaticObjectsCollectionWrapper
  nameWithType: HttpStaticObjectsCollectionWrapper
  fullName: System.Web.HttpStaticObjectsCollectionWrapper
  type: Class
  summary: Encapsulates the HTTP intrinsic object that provides a collection of application-scoped objects for the <xref href="stem.Web.HttpApplicationState.StaticObjects%2A"></xref> property.
  remarks: The HttpStaticObjectsCollectionWrapper class derives from the <xref:System.Web.HttpStaticObjectsCollectionBase> class and serves as a wrapper for the <xref:System.Web.HttpStaticObjectsCollection> class. This class exposes the functionality of the <xref:System.Web.HttpStaticObjectsCollection> class while also exposing the <xref:System.Web.HttpStaticObjectsCollectionBase> type. The <xref:System.Web.HttpStaticObjectsCollectionBase> class enables you to replace the original implementation of the <xref:System.Web.HttpStaticObjectsCollection> class in your application with a custom implementation, such as when you perform unit testing outside the ASP.NET pipeline.
